function loadMap(locations) {
    var data = '';
    for (var idx in locations) {
        if (locations[idx] != 'Overall') {
            var popup_template = "popup_template_" + locations[idx];
            var pie_district = locations[idx];

            if (idx < (locations.length - 1)) {
                data += '{"type": "Feature","properties": {"fill": "#081dbe","fill-opacity": 0.5,"description": "<div id=\'' + popup_template + '\'><div id=\'' + pie_district + '\'></div></div>","outerdiv":"' + popup_template + '","innverdiv":"' + pie_district + '"},"geometry":' + JSON.stringify(totalGeoJson[locations[idx]]) + '}' + ',';
            } else {
                data += '{"type": "Feature","properties": {"fill": "#081dbe","fill-opacity": 0.5,"description": "<div id=\'' + popup_template + '\'><div id=\'' + pie_district + '\'></div></div>","outerdiv":"' + popup_template + '","innverdiv":"' + pie_district + '"},"geometry":' + JSON.stringify(totalGeoJson[locations[idx]]) + '}';
            }
        }
    }
    return data;
}

